import App from "../App";
import ExpenseItem from "../components/ExpenseItem";
import React, { Component } from "react";
function Expenses(props) {
  return App(
    <div>
      <h2>Components</h2>
      <ExpenseItem
        title={props.title0}
        amt={props.amt0}
        date={props.date0}
      ></ExpenseItem>
      <ExpenseItem
        title={props.title1}
        amt={props.amt1}
        date={props.date1}
      ></ExpenseItem>
      <ExpenseItem
        title={props.title2}
        amt={props.amt2}
        date={props.date2}
      ></ExpenseItem>
    </div>
  );
}

export default Expenses;
